script: |
  super -f text -I q5295.spq | sort > q5295.out

inputs:
  - name: q5295.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col0 IN ( + 55 * + - col1 * + 24 - + col2 * - - col2, - ( - - col2 ) * - 21, col2 );
  - name: tab1

outputs:
  - name: q5295.out
    data: |
      51	14	96
      85	5	59
      91	47	68
